    def clear(self):
        # self._hashA = np.uint32(0)
        # self._hashB = np.uint32(0)
        self._hashA = 0
        self._hashB = 0
        # self._hashC = np.uint32(0)
        # self.hashB.fill(0)
        self.hashB = [0 for _ in range(self._hashASize)]

    def present(self):
        return self.hashB[self._hashA] == self._hashB + 1

    def move(self, x, y, who):
        offset = x + (y << 6) + (who << 11)
        self._hashA = (self._hashA + self.hashValA[offset]) % self._hashASize
        self._hashB = (self._hashB + self.hashValB[offset])


    def undo(self, x, y, who):
        offset = x + (y << 6) + (who << 11)
        hVo = self.hashValA[offset]
        if self._hashA >= hVo:
            self._hashA = (self._hashA - self.hashValA[offset]) % self._hashASize
        else:
            self._hashA = (self._hashASize - ((self.hashValA[offset] - self._hashA) % self._hashASize)) % self._hashASize
        self._hashB = (self._hashB - self.hashValB[offset])

    def value(self):
        return self._value[self._hashA]

    def depth(self):
        return self._depth[self._hashA]

    def best(self):
        return self._bestx[self._hashA], self._besty[self._hashA]

    def update(self, value, depth, bestx, besty):
        self._value[self._hashA] = value
        self._depth[self._hashA] = depth
        self._bestx[self._hashA] = bestx
        self._besty[self._hashA] = besty
        self.hashB[self._hashA] = self._hashB + 1

    def resize(self, size):
        if self._hashASize == size:
            self.clear()
        else:
            self._hashASize = size
            self.hashB = [0 for _ in range(self._hashASize)]
            self._value = [0 for _ in range(self._hashASize)]
            self._depth = [0 for _ in range(self._hashASize)]
            self._bestx = [0 for _ in range(self._hashASize)]
            self._besty = [0 for _ in range(self._hashASize)]
            self._hashASize = size

